import React from 'react'
import { useState, useEffect } from 'react'


function UserHomepage() {


    const [userData, setUserData] = useState([])



    useEffect(() => {
        getUserData()
    }, [])

    const getUserData = async () => {
        try {
            const response = await fetch('/users/<int:id>')
            const data = await response.json()
            console.log(data)
            setUserData(data)
        } catch (error) {
            console.error('error fetching user data', error)
        }





  return (
    <div class="user-profile">
        <div class="profile-picture">
            <h2>Welcome, {userData.name}</h2>
            <p>{userData.username}</p>
            <img src={userData.image} alt="Profile Picture"/>
            <p>Location: {userData.location}</p>
            <p>Member since: {userData.date_joined}</p>
            <p>Camera Equipment: {userData.camera}</p>
            <p>Editing Software: {userData.editing}</p>
            <p>Light Kit: {userData.lights}</p>
            <p>Audio Equipment: {userData.audio}</p>
            <p>Props: {userData.props}</p>

        </div>


    </div>
  )
}






}
export default UserHomepage
